pragma solidity ^0.4.25;

import "./Interfaces.sol";
import "./Helpers.sol";
import "./Enums.sol";

import "./Libs.sol";

contract CardPackage is ICardPackage, Shared,
    UsingCardBase,
    UsingCard,
    UsingSettings,
    UsingEnums
{
    using SafeMath for uint256;
    using CardByteModifier for uint256;

    uint256 public numberOfPackage;

    function _randomToRarity(
        uint256 _random,
        uint256 _rarePercent,
        uint256 _exoticPercent) internal pure returns (uint256) {
        if ((_random % 100) < _exoticPercent) {
            return 3;
        }
        if ((_random % 100) < _exoticPercent + _rarePercent) {
            return 2;
        }
        return 1; //common
    }

    function getPrice(uint256 _packageType, uint256 _currencyType) public view returns(uint256) {
        return Settings.getPackagePrice(_packageType) * Settings.getPriceCurrencyMultiplier(_currencyType);
    }

    function createPackage(address _to, uint256 _packageType, uint256 _currencyType) public __onlyShared returns (uint256 price, uint256 packageId) {
        numberOfPackage += 1; //ayni zamanda package id.
        if (_packageType == 1) {
            createPackage1(_to);
        } else if (_packageType == 2) {
            createPackage2(_to);
        } else if (_packageType == 3) {
            createPackage3(_to);
        }
        price = getPrice(_packageType, _currencyType);
        packageId = numberOfPackage;
    }

    // <1 card, rare 25%, exotic %5, price Multiplier 0.003>
    // <3 card, rare 30%, exotic %7, price Multiplier 0.003> at least one rare
    // <5 card, rare 35%, exotic %9, price Multiplier 0.003> at least two rare

    // <1 card, rare 25%, exotic %5, price Multiplier 0.003>
    function createPackage1(address _to) internal {

        //NOTE-1: zamana, kisiye ve isleme bagli degisim var. Bu sayede;
        // farkli zamanlarda farkli kartlar uretilecektir(ayni kisi ve islem icin.).
        // farkli islemlerde farkli kartlar uretilecektir.(ayni kisi ve ayni zaman dilimi icin.).
        // farki kisiler icin farkli kartlar uretilecektir.(ayni zaman dilimi ve ayni islem icin.).
        //NOTE-2: 250 block yaklasik 1 saat yapmakta. Bu sayede brute force ile paket secmek oldukca zahmetli.
        uint256[] memory rnd = new uint256[](3); //last index: random
        rnd[0] = uint256(keccak256(_to)) % 10007; //kisiye bagli degisim
        rnd[1] = uint256(keccak256(numberOfPackage)) % 10009; //isleme bagli degisim
        rnd[2] =
            uint256(keccak256(block.blockhash((block.number / 250) * 250))) %
            10037; //zamana bagli degisim

        rnd[0] = uint256(keccak256(rnd[0] * rnd[1] * rnd[2])) % 10039;

        rnd[1] = _randomToRarity(rnd[0], 25, 5); //rarity
        rnd[2] = CardBase.randomToBaseIdByRarity(rnd[0], rnd[1]); //baseid
        (rnd[0], rnd[1]) = Card.mintCardWithBaseId(_to, rnd[2]);
        emit MintedPackageCard(_to, numberOfPackage, rnd[0], rnd[1]);

    }

    // <3 card, rare 30%, exotic %7, price Multiplier 0.003> at least one rare
    function createPackage2(address _to) internal returns(uint256) {


        //index-0: random
        //index-1: common count | baseid
        //index-2: rare count
        //index-3: exotic count
        //index-4: rarity

        uint256[] memory rnd = new uint256[](7); //last index: random
        rnd[0] = uint256(keccak256(_to)) % 10007; //kisiye bagli degisim
        rnd[1] = uint256(keccak256(numberOfPackage)) % 10009; //isleme bagli degisim
        rnd[4] =
            uint256(keccak256(block.blockhash((block.number / 250) * 250))) %
            10037; //zamana bagli degisim

        for (uint256 i = 2; i < 5; i++) {

            rnd[0] = uint256(keccak256(rnd[0] * (rnd[1] + rnd[4]) * i)) % 10039;

            if(i == 4) {
                //hic rare veya exotic yok ise rare uret.
                if (rnd[2] + rnd[3] < 1) {
                    rnd[4] = 2; //rare
                } else {
                    rnd[4] = _randomToRarity(rnd[0], 30, 7); //rarity
                }
            } else {
                rnd[4] = _randomToRarity(rnd[0], 30, 7); //rarity
            }

            rnd[1] = CardBase.randomToBaseIdByRarity(rnd[0], rnd[4]); //baseid
         
            (rnd[5], rnd[6]) = Card.mintCardWithBaseId(_to, rnd[1]);
            emit MintedPackageCard(_to, numberOfPackage, rnd[5], rnd[6]);

            //rnd4 -> index 1,2,3 not: 1 onemsiz. 2 ile 3 daha once kullanilmadi.
            rnd[rnd[4]] += 1;

        }

    }

    // <5 card, rare 35%, exotic %9, price Multiplier 0.003> at least two rare
    function createPackage3(address _to) internal returns(uint256) {

        //index-0: random
        //index-1: common count | baseid
        //index-2: rare count
        //index-3: exotic count
        //index-4: rarity

        uint256[] memory rnd = new uint256[](7); //last index: random
        rnd[0] = uint256(keccak256(_to)) % 10007; //kisiye bagli degisim
        rnd[1] = uint256(keccak256(numberOfPackage)) % 10009; //isleme bagli degisim
        rnd[4] =
            uint256(keccak256(block.blockhash((block.number / 250) * 250))) %
            10037; //zamana bagli degisim

        for (uint256 i = 2; i < 7; i++) {

            rnd[0] = uint256(keccak256(rnd[0] * (rnd[1] + rnd[4]) * i)) % 10039;

            if(i == 5 || i == 6) {
                //hic rare veya exotic yok ise rare uret.
                if (rnd[2] + rnd[3] < 2) {
                    rnd[4] = 2; //rare
                } else {
                    rnd[4] = _randomToRarity(rnd[0], 35, 9); //rarity
                }
            } else {
                rnd[4] = _randomToRarity(rnd[0], 35, 9); //rarity
            }

            rnd[1] = CardBase.randomToBaseIdByRarity(rnd[0], rnd[4]); //baseid
         
            (rnd[5], rnd[6]) = Card.mintCardWithBaseId(_to, rnd[1]);
            emit MintedPackageCard(_to, numberOfPackage, rnd[5], rnd[6]);

            //rnd4 -> index 1,2,3 not: 1 onemsiz. 2 ile 3 daha once kullanilmadi.
            rnd[rnd[4]] += 1;

        }

    }

}
